import React, { useEffect, useState } from 'react';
import { Link } from 'react-router-dom';
import { motion, useScroll, useTransform, useInView } from 'framer-motion';
import { FaPhone, FaCalendarAlt, FaUserMd, FaHeart, FaShieldAlt, FaStar, FaArrowDown, FaCheckCircle } from 'react-icons/fa';

const Home = () => {
  const [mousePosition, setMousePosition] = useState({ x: 0, y: 0 });
  const { scrollY } = useScroll();
  const y1 = useTransform(scrollY, [0, 300], [0, -50]);
  const y2 = useTransform(scrollY, [0, 300], [0, -100]);

  useEffect(() => {
    const handleMouseMove = (e) => {
      setMousePosition({ x: e.clientX, y: e.clientY });
    };
    window.addEventListener('mousemove', handleMouseMove);
    return () => window.removeEventListener('mousemove', handleMouseMove);
  }, []);

  const services = [
    {
      icon: <FaUserMd className="w-8 h-8" />,
      title: "Diabetic Foot Care",
      description: "Specialized care for diabetic patients with comprehensive foot assessments and treatment.",
      color: "from-blue-400 to-blue-600"
    },
    {
      icon: <FaHeart className="w-8 h-8" />,
      title: "Nail Care & Treatment",
      description: "Professional nail cutting, trimming, and treatment for various nail conditions.",
      color: "from-pink-400 to-pink-600"
    },
    {
      icon: <FaShieldAlt className="w-8 h-8" />,
      title: "Skin Treatment",
      description: "Expert care for corns, calluses, dry skin, and other foot skin conditions.",
      color: "from-green-400 to-green-600"
    },
    {
      icon: <FaStar className="w-8 h-8" />,
      title: "Wellness Services",
      description: "Comprehensive foot wellness including massage, education, and preventive care.",
      color: "from-purple-400 to-purple-600"
    }
  ];

  const testimonials = [
    {
      name: "Sarah M.",
      text: "Sima provided excellent care for my diabetic foot condition. Very professional and caring.",
      rating: 5,
      avatar: "ðŸ‘©â€âš•ï¸"
    },
    {
      name: "John D.",
      text: "Finally found someone who understands foot care. The clinic is clean and welcoming.",
      rating: 5,
      avatar: "ðŸ‘¨â€ðŸ’¼"
    },
    {
      name: "Maria L.",
      text: "Outstanding service! My feet feel so much better after the treatment. Highly recommend.",
      rating: 5,
      avatar: "ðŸ‘©â€ðŸŽ“"
    }
  ];

  const stats = [
    { number: "500+", label: "Happy Patients" },
    { number: "5+", label: "Years Experience" },
    { number: "15+", label: "Services Offered" },
    { number: "100%", label: "Satisfaction Rate" }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { y: 20, opacity: 0 },
    visible: {
      y: 0,
      opacity: 1,
      transition: {
        type: "spring",
        stiffness: 100
      }
    }
  };

  const FloatingElement = ({ children, delay = 0 }) => (
    <motion.div
      animate={{
        y: [-10, 10, -10],
        rotate: [-1, 1, -1]
      }}
      transition={{
        duration: 4,
        repeat: Infinity,
        delay
      }}
    >
      {children}
    </motion.div>
  );

  const AnimatedCounter = ({ end, duration = 2 }) => {
    const [count, setCount] = useState(0);
    const ref = React.useRef();
    const isInView = useInView(ref);

    useEffect(() => {
      if (isInView) {
        let startTime;
        const animate = (currentTime) => {
          if (!startTime) startTime = currentTime;
          const progress = Math.min((currentTime - startTime) / (duration * 1000), 1);
          setCount(Math.floor(progress * parseInt(end)));
          if (progress < 1) requestAnimationFrame(animate);
        };
        requestAnimationFrame(animate);
      }
    }, [isInView, end, duration]);

    return <span ref={ref}>{count}{end.includes('+') ? '+' : end.includes('%') ? '%' : ''}</span>;
  };

  return (
    <div className="overflow-hidden">
      {/* Floating Background Elements */}
      <div className="fixed inset-0 pointer-events-none z-0">
        <FloatingElement delay={0}>
          <div className="absolute top-20 left-10 w-20 h-20 bg-primary/10 rounded-full blur-xl" />
        </FloatingElement>
        <FloatingElement delay={1}>
          <div className="absolute top-40 right-20 w-32 h-32 bg-secondary/10 rounded-full blur-xl" />
        </FloatingElement>
        <FloatingElement delay={2}>
          <div className="absolute bottom-40 left-1/4 w-24 h-24 bg-accent/10 rounded-full blur-xl" />
        </FloatingElement>
      </div>

      {/* Mouse Follower */}
      <motion.div
        className="fixed w-4 h-4 bg-primary/20 rounded-full pointer-events-none z-50 mix-blend-difference"
        animate={{
          x: mousePosition.x - 8,
          y: mousePosition.y - 8
        }}
        transition={{ type: "spring", stiffness: 500, damping: 28 }}
      />

      {/* Hero Section */}
      <section className="relative bg-gradient-to-br from-primary via-secondary to-accent text-white py-20 min-h-screen flex items-center overflow-hidden">
        {/* Animated Background Pattern */}
        <div className="absolute inset-0 opacity-10">
          <motion.div
            className="absolute inset-0"
            style={{
              backgroundImage: `radial-gradient(circle at 25% 25%, white 2px, transparent 2px)`,
              backgroundSize: '50px 50px'
            }}
            animate={{
              backgroundPosition: ['0px 0px', '50px 50px']
            }}
            transition={{
              duration: 20,
              repeat: Infinity,
              ease: "linear"
            }}
          />
        </div>

        <motion.div style={{ y: y1 }} className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 relative z-10">
          <div className="text-center">
            <motion.div
              initial={{ scale: 0 }}
              animate={{ scale: 1 }}
              transition={{ duration: 0.5, type: "spring" }}
              className="mb-6"
            >
              <span className="inline-block px-4 py-2 bg-white/20 backdrop-blur-sm rounded-full text-sm font-medium mb-4">
                âœ¨ Professional Foot Care Services
              </span>
            </motion.div>
            
            <motion.h1
              initial={{ opacity: 0, y: 50 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.2 }}
              className="text-5xl md:text-7xl font-bold mb-6 leading-tight"
            >
              <motion.span
                animate={{ 
                  backgroundPosition: ['0%', '100%'],
                }}
                transition={{
                  duration: 3,
                  repeat: Infinity,
                  repeatType: "reverse"
                }}
                className="bg-gradient-to-r from-white via-yellow-200 to-white bg-clip-text text-transparent bg-300%"
              >
                Healthy Feet,
              </motion.span>
              <br />
              <motion.span
                initial={{ opacity: 0, x: -50 }}
                animate={{ opacity: 1, x: 0 }}
                transition={{ duration: 0.8, delay: 0.5 }}
              >
                Happy Life
              </motion.span>
            </motion.h1>
            
            <motion.p
              initial={{ opacity: 0, y: 30 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.8, delay: 0.4 }}
              className="text-xl md:text-2xl mb-8 max-w-3xl mx-auto leading-relaxed"
            >
              Professional Foot Care & Wellness Services in 
              <motion.span
                animate={{ color: ['#ffffff', '#fbbf24', '#ffffff'] }}
                transition={{ duration: 2, repeat: Infinity }}
                className="font-semibold"
              >
                Calgary, Alberta
              </motion.span>
            </motion.p>
            
            <motion.div
              variants={containerVariants}
              initial="hidden"
              animate="visible"
              className="flex flex-col sm:flex-row gap-4 justify-center mb-12"
            >
              <motion.div variants={itemVariants}>
                <Link
                  to="/book-appointment"
                  className="group bg-white text-primary px-8 py-4 rounded-full font-semibold hover:bg-yellow-100 transition-all duration-300 inline-flex items-center justify-center space-x-2 shadow-lg hover:shadow-xl transform hover:-translate-y-1"
                >
                  <motion.div
                    whileHover={{ rotate: 360 }}
                    transition={{ duration: 0.3 }}
                  >
                    <FaCalendarAlt className="w-5 h-5" />
                  </motion.div>
                  <span>Book Appointment</span>
                  <motion.div
                    className="w-0 group-hover:w-6 transition-all duration-300 overflow-hidden"
                  >
                    <FaArrowDown className="w-4 h-4 rotate-[-90deg]" />
                  </motion.div>
                </Link>
              </motion.div>
              
              <motion.div variants={itemVariants}>
                <motion.a
                  href="tel:403-903-4293"
                  whileHover={{ scale: 1.05 }}
                  whileTap={{ scale: 0.95 }}
                  className="border-2 border-white text-white px-8 py-4 rounded-full font-semibold hover:bg-white hover:text-primary transition-all duration-300 inline-flex items-center justify-center space-x-2 backdrop-blur-sm"
                >
                  <motion.div
                    animate={{ rotate: [0, 10, -10, 0] }}
                    transition={{ duration: 2, repeat: Infinity }}
                  >
                    <FaPhone className="w-5 h-5" />
                  </motion.div>
                  <span>Call Now</span>
                </motion.a>
              </motion.div>
            </motion.div>

            {/* Scroll Indicator */}
            <motion.div
              initial={{ opacity: 0 }}
              animate={{ opacity: 1 }}
              transition={{ delay: 1.5 }}
              className="absolute bottom-8 left-1/2 transform -translate-x-1/2"
            >
              <motion.div
                animate={{ y: [0, 10, 0] }}
                transition={{ duration: 2, repeat: Infinity }}
                className="text-white/70 text-center"
              >
                <p className="text-sm mb-2">Scroll to explore</p>
                <FaArrowDown className="w-4 h-4 mx-auto" />
              </motion.div>
            </motion.div>
          </div>
        </motion.div>
      </section>

      {/* Stats Section */}
      <motion.section 
        style={{ y: y2 }}
        className="py-16 bg-white relative"
      >
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 50 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="grid grid-cols-2 md:grid-cols-4 gap-8 text-center"
          >
            {stats.map((stat, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, scale: 0.5 }}
                whileInView={{ opacity: 1, scale: 1 }}
                transition={{ duration: 0.5, delay: index * 0.1 }}
                viewport={{ once: true }}
                className="p-6"
              >
                <motion.div
                  whileHover={{ scale: 1.1 }}
                  className="text-3xl md:text-4xl font-bold text-primary mb-2"
                >
                  <AnimatedCounter end={stat.number} />
                </motion.div>
                <p className="text-gray-600 font-medium">{stat.label}</p>
              </motion.div>
            ))}
          </motion.div>
        </div>
      </motion.section>

      {/* Service Highlights */}
      <section className="py-20 bg-gradient-to-b from-white to-accent/20">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="text-center mb-16"
          >
            <motion.span
              initial={{ opacity: 0, scale: 0 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5 }}
              viewport={{ once: true }}
              className="inline-block px-4 py-2 bg-primary/10 text-primary rounded-full text-sm font-medium mb-4"
            >
              Our Expertise
            </motion.span>
            <h2 className="text-4xl md:text-5xl font-bold text-text mb-6">
              Comprehensive 
              <motion.span
                animate={{ color: ['#1e5a5a', '#2d7a7a', '#1e5a5a'] }}
                transition={{ duration: 3, repeat: Infinity }}
              >
                Foot Care
              </motion.span>
            </h2>
            <p className="text-lg text-gray-600 max-w-2xl mx-auto">
              Advanced treatments designed to keep your feet healthy, comfortable, and pain-free
            </p>
          </motion.div>
          
          <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-8">
            {services.map((service, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 50, rotateY: -15 }}
                whileInView={{ opacity: 1, y: 0, rotateY: 0 }}
                transition={{ 
                  duration: 0.8, 
                  delay: index * 0.1,
                  type: "spring",
                  stiffness: 100
                }}
                viewport={{ once: true }}
                whileHover={{ 
                  y: -10, 
                  rotateY: 5,
                  transition: { duration: 0.3 }
                }}
                className="group relative bg-white rounded-2xl p-8 text-center hover:shadow-2xl transition-all duration-500 border border-gray-100 overflow-hidden"
              >
                {/* Animated Background */}
                <motion.div
                  className={`absolute inset-0 bg-gradient-to-br ${service.color} opacity-0 group-hover:opacity-10 transition-opacity duration-500`}
                />
                
                {/* Floating Icon */}
                <motion.div
                  whileHover={{ 
                    scale: 1.2,
                    rotate: 360
                  }}
                  transition={{ duration: 0.5 }}
                  className="text-primary mb-6 flex justify-center relative z-10"
                >
                  <div className="p-4 bg-primary/10 rounded-full">
                    {service.icon}
                  </div>
                </motion.div>
                
                <h3 className="text-xl font-bold text-text mb-4 group-hover:text-primary transition-colors duration-300">
                  {service.title}
                </h3>
                <p className="text-gray-600 mb-6 leading-relaxed">
                  {service.description}
                </p>
                
                <motion.div
                  initial={{ opacity: 0, x: -20 }}
                  whileInView={{ opacity: 1, x: 0 }}
                  transition={{ delay: 0.3 }}
                  viewport={{ once: true }}
                >
                  <Link
                    to="/services"
                    className="inline-flex items-center text-primary font-semibold hover:text-secondary transition-colors group-hover:translate-x-2 transform transition-transform duration-300"
                  >
                    Learn More 
                    <motion.span
                      animate={{ x: [0, 5, 0] }}
                      transition={{ duration: 1.5, repeat: Infinity }}
                      className="ml-2"
                    >
                      â†’
                    </motion.span>
                  </Link>
                </motion.div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Testimonials */}
      <section className="py-20 bg-gradient-to-br from-accent/30 to-primary/10">
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
            className="text-center mb-16"
          >
            <motion.span
              initial={{ opacity: 0, scale: 0 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ duration: 0.5 }}
              viewport={{ once: true }}
              className="inline-block px-4 py-2 bg-white/80 text-primary rounded-full text-sm font-medium mb-4"
            >
              Patient Stories
            </motion.span>
            <h2 className="text-4xl md:text-5xl font-bold text-text mb-6">
              What Our Patients Say
            </h2>
            <p className="text-lg text-gray-600">
              Real experiences from our valued patients
            </p>
          </motion.div>
          
          <div className="grid grid-cols-1 md:grid-cols-3 gap-8">
            {testimonials.map((testimonial, index) => (
              <motion.div
                key={index}
                initial={{ opacity: 0, y: 50, scale: 0.9 }}
                whileInView={{ opacity: 1, y: 0, scale: 1 }}
                transition={{ 
                  duration: 0.8, 
                  delay: index * 0.2,
                  type: "spring"
                }}
                viewport={{ once: true }}
                whileHover={{ 
                  y: -5,
                  transition: { duration: 0.3 }
                }}
                className="bg-white rounded-2xl p-8 shadow-lg hover:shadow-2xl transition-all duration-500 relative overflow-hidden group"
              >
                {/* Decorative Element */}
                <motion.div
                  className="absolute top-0 right-0 w-20 h-20 bg-gradient-to-br from-primary/10 to-secondary/10 rounded-full transform translate-x-10 -translate-y-10 group-hover:scale-150 transition-transform duration-500"
                />
                
                {/* Avatar */}
                <motion.div
                  whileHover={{ scale: 1.1, rotate: 5 }}
                  className="text-4xl mb-4 relative z-10"
                >
                  {testimonial.avatar}
                </motion.div>
                
                {/* Stars */}
                <motion.div 
                  className="flex mb-6 relative z-10"
                  initial={{ opacity: 0 }}
                  whileInView={{ opacity: 1 }}
                  transition={{ delay: 0.5 }}
                  viewport={{ once: true }}
                >
                  {[...Array(testimonial.rating)].map((_, i) => (
                    <motion.div
                      key={i}
                      initial={{ opacity: 0, scale: 0 }}
                      whileInView={{ opacity: 1, scale: 1 }}
                      transition={{ delay: 0.6 + i * 0.1 }}
                      viewport={{ once: true }}
                    >
                      <FaStar className="w-5 h-5 text-yellow-400" />
                    </motion.div>
                  ))}
                </motion.div>
                
                <motion.p
                  initial={{ opacity: 0 }}
                  whileInView={{ opacity: 1 }}
                  transition={{ delay: 0.7 }}
                  viewport={{ once: true }}
                  className="text-gray-600 mb-6 italic leading-relaxed relative z-10"
                >
                  "{testimonial.text}"
                </motion.p>
                
                <motion.div
                  initial={{ opacity: 0, x: -20 }}
                  whileInView={{ opacity: 1, x: 0 }}
                  transition={{ delay: 0.8 }}
                  viewport={{ once: true }}
                  className="flex items-center relative z-10"
                >
                  <FaCheckCircle className="w-5 h-5 text-green-500 mr-2" />
                  <p className="font-bold text-text">
                    {testimonial.name}
                  </p>
                </motion.div>
              </motion.div>
            ))}
          </div>
        </div>
      </section>

      {/* Enhanced CTA Section */}
      <section className="py-20 bg-gradient-to-r from-primary via-secondary to-primary text-white relative overflow-hidden">
        {/* Animated Background Elements */}
        <div className="absolute inset-0">
          <motion.div
            animate={{
              scale: [1, 1.2, 1],
              rotate: [0, 180, 360]
            }}
            transition={{
              duration: 20,
              repeat: Infinity,
              ease: "linear"
            }}
            className="absolute top-10 left-10 w-32 h-32 border border-white/20 rounded-full"
          />
          <motion.div
            animate={{
              scale: [1.2, 1, 1.2],
              rotate: [360, 180, 0]
            }}
            transition={{
              duration: 15,
              repeat: Infinity,
              ease: "linear"
            }}
            className="absolute bottom-10 right-10 w-24 h-24 border border-white/20 rounded-full"
          />
        </div>
        
        <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 text-center relative z-10">
          <motion.div
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            <motion.h2
              className="text-4xl md:text-5xl font-bold mb-6"
              animate={{
                backgroundPosition: ['0%', '100%']
              }}
              transition={{
                duration: 3,
                repeat: Infinity,
                repeatType: "reverse"
              }}
              style={{
                background: 'linear-gradient(90deg, #ffffff, #fbbf24, #ffffff)',
                backgroundSize: '200%',
                WebkitBackgroundClip: 'text',
                WebkitTextFillColor: 'transparent'
              }}
            >
              Ready to Take Care of Your Feet?
            </motion.h2>
            
            <motion.p
              initial={{ opacity: 0 }}
              whileInView={{ opacity: 1 }}
              transition={{ delay: 0.3 }}
              viewport={{ once: true }}
              className="text-xl mb-10 max-w-2xl mx-auto leading-relaxed"
            >
              Book your appointment today and take the first step towards healthier, happier feet.
            </motion.p>
            
            <motion.div
              initial={{ opacity: 0, scale: 0.8 }}
              whileInView={{ opacity: 1, scale: 1 }}
              transition={{ delay: 0.5, type: "spring" }}
              viewport={{ once: true }}
            >
              <Link
                to="/book-appointment"
                className="group bg-white text-primary px-10 py-4 rounded-full font-bold hover:bg-yellow-100 transition-all duration-300 inline-flex items-center space-x-3 shadow-2xl hover:shadow-3xl transform hover:-translate-y-2"
              >
                <motion.div
                  whileHover={{ rotate: 360, scale: 1.2 }}
                  transition={{ duration: 0.5 }}
                >
                  <FaCalendarAlt className="w-6 h-6" />
                </motion.div>
                <span className="text-lg">Schedule Your Visit</span>
                <motion.div
                  animate={{ x: [0, 5, 0] }}
                  transition={{ duration: 1.5, repeat: Infinity }}
                >
                  <FaArrowDown className="w-5 h-5 rotate-[-90deg]" />
                </motion.div>
              </Link>
            </motion.div>
          </motion.div>
        </div>
      </section>
    </div>
  );
};

export default Home;
